css:
:root {
  font-size: 16px;
}
atom-text-editor.vim-mode-plus.normal-mode.is-focused .cursor,
atom-text-editor.vim-mode-plus.visual-mode.is-focused .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  background-color: #009688;
  visibility: visible;
}
atom-text-editor.vim-mode-plus-input-char-waiting.is-focused .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.3em solid #009688;
  visibility: visible;
  border-bottom-width: .2em;
}
atom-text-editor.vim-mode-plus-input-char-waiting.hide-cursor.is-focused .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.3em solid #009688;
  visibility: hidden;
}
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.6em solid #009688;
  visibility: visible;
}
atom-text-editor.vim-mode-plus.operator-pending-mode.is-focused .cursors.blink-off .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.6em solid #009688;
  visibility: hidden;
}
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.3em solid #009688;
  visibility: visible;
}
atom-text-editor.vim-mode-plus.insert-mode.replace.is-focused .cursors.blink-off .cursor {
  border: none;
  background: none;
  opacity: 0.5;
  border-bottom: 0.3em solid #009688;
  visibility: hidden;
}
@keyframes vim-mode-plus-flash-operator {
  from {
    background-color: #41555f;
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-operator-long {
  from {
    background-color: #41555f;
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-operator-demo {
  from {
    background-color: #41555f;
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-operator-occurrence {
  from {
    background-color: rgba(173, 223, 99, 0.5);
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-operator-remove-occurrence {
  from {
    background-color: rgba(240, 113, 120, 0.5);
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-undo-redo {
  from {
    background-color: #41555f;
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-undo-redo-multiple-changes {
  from {
    background-color: rgba(173, 223, 99, 0.5);
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-undo-redo-multiple-delete {
  from {
    background-color: rgba(240, 113, 120, 0.5);
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-search {
  from {
    background-color: rgba(0, 0, 204, 0.8);
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-screen {
  from {
    background-color: #41555f;
  }
  to {
    background-color: transparent;
  }
}
@keyframes vim-mode-plus-flash-line {
  from {
    background-color: rgba(0, 0, 204, 0.8);
  }
  to {
    background-color: transparent;
  }
}
atom-text-editor .vim-mode-plus-flash.operator .region {
  animation-name: vim-mode-plus-flash-operator;
  animation-duration: 0.3s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.operator-long .region {
  animation-name: vim-mode-plus-flash-operator;
  animation-duration: 0.8s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.operator-demo .region {
  animation-name: vim-mode-plus-flash-operator;
  animation-duration: 2s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.operator-occurrence .region {
  animation-name: vim-mode-plus-flash-operator-occurrence;
  animation-duration: 0.8s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.operator-remove-occurrence .region {
  animation-name: vim-mode-plus-flash-operator-remove-occurrence;
  animation-duration: 0.8s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.undo-redo .region {
  animation-name: vim-mode-plus-flash-undo-redo;
  animation-duration: 0.5s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.undo-redo-multiple-changes .region {
  animation-name: vim-mode-plus-flash-undo-redo-multiple-changes;
  animation-duration: 0.5s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.undo-redo-multiple-delete .region {
  animation-name: vim-mode-plus-flash-undo-redo-multiple-delete;
  animation-duration: 0.5s;
  animation-iteration-count: 1;
}
atom-text-editor .vim-mode-plus-flash.search .region {
  animation-name: vim-mode-plus-flash-search;
  animation-duration: 0.5s;
  animation-iteration-count: 1;
  z-index: 1;
}
atom-text-editor .vim-mode-plus-flash.screen .region {
  animation-name: vim-mode-plus-flash-screen;
  animation-duration: 0.3s;
  animation-iteration-count: 1;
}
.vim-mode-plus-hover {
  display: block;
  color: rgba(238, 255, 255, 0.6);
  background-color: transparent;
  border-radius: 0.125rem;
  box-shadow: 0 0 1px #eeffff;
  margin-top: -2.8em;
  margin-left: -0.3em;
  padding-left: 0.2em;
  padding-right: 0.2em;
  text-align: center;
}
.vim-mode-plus-hover.first {
  background-color: #9acffa;
}
.vim-mode-plus-hover.last {
  background-color: #fbb4af;
}
.vim-mode-plus-input atom-text-editor[mini] {
  background-color: inherit;
  border: none;
  width: 100%;
  height: 0px;
  font-weight: normal;
  color: rgba(238, 255, 255, 0.8);
  line-height: 1.28;
  cursor: default;
  white-space: nowrap;
  padding-left: 10px;
}
.vim-mode-plus-input atom-text-editor[mini].is-focused {
  box-shadow: none;
}
.vim-mode-plus-search-container {
  display: flex;
}
.vim-mode-plus-search-container > div {
  padding: 0.25rem 0.5rem;
  border: none;
}
.vim-mode-plus-search-container .editor-container {
  width: 100%;
}
atom-text-editor[mini].vim-mode-plus-search {
  border: none;
  color: rgba(238, 255, 255, 0.8);
  cursor: default;
}
atom-text-editor[mini].vim-mode-plus-search.is-focused {
  box-shadow: none;
}
atom-text-editor[mini].vim-mode-plus-search::before {
  font-size: 1.2em;
  padding-right: 0.5em;
  content: '/';
}
atom-text-editor[mini].vim-mode-plus-search.backwards::before {
  content: '?';
}
.vim-mode-plus.round-box {
  box-sizing: border-box;
  border-radius: 0.125rem;
}
.vim-mode-plus.solid-box {
  box-sizing: border-box;
}
.vim-mode-plus.underline-dotted {
  box-sizing: border-box;
  border-bottom-width: 2px;
  border-bottom-style: dotted;
}
.vim-mode-plus.underline-solid {
  box-sizing: border-box;
  border-bottom-width: 3px;
  border-bottom-style: solid;
}
atom-text-editor:not(.silent) .vim-mode-plus-search-match .region {
  background-color: rgba(178, 204, 214, 0.4);
}
atom-text-editor:not(.silent) .vim-mode-plus-search-match.first .region {
  background-color: rgba(130, 170, 255, 0.4);
}
atom-text-editor:not(.silent) .vim-mode-plus-search-match.last .region {
  background-color: rgba(240, 113, 120, 0.4);
}
atom-text-editor .vim-mode-plus-search-match .region {
  box-sizing: border-box;
  border-radius: 0.125rem;
  border: 2px solid transparent;
  transition: border-color 0.2s;
}
atom-text-editor .vim-mode-plus-search-match.current .region {
  border-color: #b2ccd6;
  transition-duration: .1s;
}
atom-text-editor .vim-mode-plus-search-match.first.current .region {
  border-color: search-match-border-first;
}
atom-text-editor .vim-mode-plus-search-match.last.current .region {
  border-color: syntax-color-removed;
}
atom-text-editor .vim-mode-plus-highlight-search .region {
  box-sizing: border-box;
  border-radius: 0.125rem;
  border: 1px solid rgba(238, 255, 255, 0.3);
  background-color: #3b4d56;
}
atom-text-editor .vim-mode-plus-persistent-selection .region {
  background-color: #3b4d56;
}
atom-text-editor .vim-mode-plus-target-range .region {
  background-color: #3b4d56;
}
atom-text-editor .vim-mode-plus-occurrence-base .region {
  box-sizing: border-box;
  border-bottom-width: 2px;
  border-bottom-style: dotted;
  z-index: 1;
  border-color: #ffcb6b;
}
atom-workspace.vim-mode-plus--pane-maximized atom-pane-container {
  position: relative;
}
atom-workspace.vim-mode-plus--pane-maximized atom-pane-container atom-pane-axis:not(.vim-mode-plus--active-pane-axis) {
  display: none;
}
atom-workspace.vim-mode-plus--pane-maximized atom-pane-container atom-pane {
  display: none;
}
atom-workspace.vim-mode-plus--pane-maximized atom-pane-container atom-pane .item-views {
  background: #263238 !important;
}
atom-workspace.vim-mode-plus--pane-maximized atom-pane-container atom-pane.active {
  display: flex;
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  z-index: 100;
}
atom-workspace.vim-mode-plus--pane-maximized atom-text-editor:not(.mini) {
  margin-left: 20%;
}
atom-workspace.vim-mode-plus--pane-maximized.vim-mode-plus--hide-tab-bar .tab-bar {
  display: none;
}
atom-workspace.vim-mode-plus--pane-maximized.vim-mode-plus--hide-status-bar .status-bar {
  display: none;
}
.vim-mode-plus-select-list .list-group .character-match {
  color: rgba(238, 255, 255, 0.6);
  font-weight: bold;
}
.demo-mode-container .kind {
  color: rgba(238, 255, 255, 0.6);
}
